void icsd_anc_config_board_init(__icsd_anc_config_data *SD_CFG)
{
    if (SD_CFG) {
        //
        SD_CFG->pnc_times = 1;
        SD_CFG->vld1 = 0;
        SD_CFG->vld2 = 0;
        SD_CFG->sz_pri_thr = 60;
        SD_CFG->bypass_vol = 3;
        SD_CFG->sz_calr_sign = 1;
        SD_CFG->pz_calr_sign = 1;
        SD_CFG->bypass_calr_sign = 1;
        SD_CFG->perf_calr_sign = 1;
        SD_CFG->train_mode = 0;
        SD_CFG->tonel_delay = 900;
        SD_CFG->toner_delay = 1500;
        SD_CFG->pzl_delay = 700;
        SD_CFG->pzr_delay = 1200;
        SD_CFG->ear_recorder = 0;
        SD_CFG->fb_agc_en = 0;
        //
        SD_CFG->ff_yorder  = ANC_ADAPTIVE_FF_ORDER;
        SD_CFG->fb_yorder  = ANC_ADAPTIVE_FB_ORDER;
        //SD_CFG->cmp_yorder = ANC_ADAPTIVE_CMP_ORDER;
        SD_CFG->tool_ffgain_sign = -1;
        SD_CFG->tool_fbgain_sign = -1;

        if (ICSD_ANC_CPU == ICSD_BR28) {
            printf("ICSD BR28 SEL\n");
            SD_CFG->normal_out_sel_l = BR28_ANC_USER_TRAIN_OUT_SEL_L;
            SD_CFG->normal_out_sel_r = BR28_ANC_USER_TRAIN_OUT_SEL_R;
            SD_CFG->tone_out_sel_l   = BR28_ANC_TONE_TRAIN_OUT_SEL_L;
            SD_CFG->tone_out_sel_r   = BR28_ANC_TONE_TRAIN_OUT_SEL_R;
        } else if (ICSD_ANC_CPU == ICSD_BR50) {
            printf("ICSD BR50 SEL\n");
            SD_CFG->normal_out_sel_l = BR50_ANC_USER_TRAIN_OUT_SEL_L;
            SD_CFG->normal_out_sel_r = BR50_ANC_USER_TRAIN_OUT_SEL_R;
            SD_CFG->tone_out_sel_l   = BR50_ANC_TONE_TRAIN_OUT_SEL_L;
            SD_CFG->tone_out_sel_r   = BR50_ANC_TONE_TRAIN_OUT_SEL_R;
        } else {
            printf("CPU ERR\n");
        }
        /***************************************************/
        /**************** left channel config **************/
        /***************************************************/
        SD_CFG->adpt_cfg.pnc_times = 1;
        // target
        SD_CFG->adpt_cfg.cmp_en = tg_cmp_en;
        SD_CFG->adpt_cfg.target_cmp_num = target_cmp_num;
        SD_CFG->adpt_cfg.target_sv = (float *)target_sv;
        SD_CFG->adpt_cfg.target_cmp_dat = (float *) tg_cmp;

        // 
        SD_CFG->adpt_cfg.IIR_NUM_FLEX = ICSD_IIR_NUM_FLEX;
        SD_CFG->adpt_cfg.IIR_NUM_FIX  = ICSD_IIR_NUM_FIX;

        printf("---------order--------------- %d, %d\n", SD_CFG->adpt_cfg.IIR_NUM_FIX, SD_CFG->adpt_cfg.IIR_NUM_FLEX);

        for (int i = 0; i < 62; i++) {
            SD_CFG->adpt_cfg.Vrange_H[i] = Vrange_left_h[i];
            SD_CFG->adpt_cfg.Vrange_M[i] = Vrange_left_m[i];
            SD_CFG->adpt_cfg.Vrange_L[i] = Vrange_left_l[i];
        }

        for (int i = 0; i < 31; i++) {
            SD_CFG->adpt_cfg.Biquad_init_H[i] = biquad_left_h[i];
            SD_CFG->adpt_cfg.Biquad_init_M[i] = biquad_left_m[i];
            SD_CFG->adpt_cfg.Biquad_init_L[i] = biquad_left_l[i];
        }

        for (int i = 0; i < 10; i++) {
            SD_CFG->adpt_cfg.biquad_type[i] = biquad_type[i];
        }

        for (int i = 0; i < 7; i++) {
            SD_CFG->adpt_cfg.degree_set0[i] = _degree_set0[i];
            SD_CFG->adpt_cfg.degree_set1[i] = _degree_set1[i];
            SD_CFG->adpt_cfg.degree_set2[i] = _degree_set2[i];
        }

        printf("%d <<<<<<<<\n", (int)(SD_CFG->adpt_cfg.Vrange_H[0] * 1000));

        SD_CFG->adpt_cfg.Weight_H = (float *)weight_h;
        SD_CFG->adpt_cfg.Weight_M = (float *)weight_m;
        SD_CFG->adpt_cfg.Weight_L = (float *)weight_l;
        SD_CFG->adpt_cfg.Gold_csv_H = (float *)mse_tar_h;
        SD_CFG->adpt_cfg.Gold_csv_M = (float *)mse_tar_m;
        SD_CFG->adpt_cfg.Gold_csv_L = (float *)mse_tar_l;

        SD_CFG->adpt_cfg.total_gain_adj_begin = total_gain_adj_begin;
        SD_CFG->adpt_cfg.total_gain_adj_end = total_gain_adj_end;
        SD_CFG->adpt_cfg.gain_limit_all = GAIN_LIMIT_ALL;

        printf(">>>>>>>>>>>>>>>>>>>>> %d\n", (int)(SD_CFG->adpt_cfg.Gold_csv_H[0] * 1000));
        printf(">>>>>>>>>>>>>>>>>>>>> %d\n", (int)(SD_CFG->adpt_cfg.Gold_csv_M[0] * 1000));
        printf(">>>>>>>>>>>>>>>>>>>>> %d\n", (int)(SD_CFG->adpt_cfg.Gold_csv_L[0] * 1000));

        // 
        SD_CFG->adpt_cfg.mem_curve_nums = mem_curves;
        SD_CFG->adpt_cfg.sz_table = (float *)sz_table;
        SD_CFG->adpt_cfg.pz_table = (float *)pz_table;
        SD_CFG->adpt_cfg.pz_table_cmp = NULL;
        SD_CFG->adpt_cfg.sz_table_cmp = NULL;
#if EXT_PRINTF_DEBUG
        for (int i = 0; i < 60; i++) {
            printf("idx=%d, mse=%d, weight=%d\n", i, (int)SD_CFG->adpt_cfg.Gold_csv_H[i], (int)SD_CFG->adpt_cfg.Weight_H[i]);
        }

        de_vrange_printf(SD_CFG->adpt_cfg.Vrange_H, SD_CFG->adpt_cfg.IIR_NUM_FLEX + SD_CFG->adpt_cfg.IIR_NUM_FIX);
        de_vrange_printf(SD_CFG->adpt_cfg.Vrange_M, SD_CFG->adpt_cfg.IIR_NUM_FLEX + SD_CFG->adpt_cfg.IIR_NUM_FIX);
        de_vrange_printf(SD_CFG->adpt_cfg.Vrange_L, SD_CFG->adpt_cfg.IIR_NUM_FLEX + SD_CFG->adpt_cfg.IIR_NUM_FIX);

        de_biquad_printf(SD_CFG->adpt_cfg.Biquad_init_H, SD_CFG->adpt_cfg.IIR_NUM_FLEX + SD_CFG->adpt_cfg.IIR_NUM_FIX);
        de_biquad_printf(SD_CFG->adpt_cfg.Biquad_init_M, SD_CFG->adpt_cfg.IIR_NUM_FLEX + SD_CFG->adpt_cfg.IIR_NUM_FIX);
        de_biquad_printf(SD_CFG->adpt_cfg.Biquad_init_L, SD_CFG->adpt_cfg.IIR_NUM_FLEX + SD_CFG->adpt_cfg.IIR_NUM_FIX);
#endif

#if TCFG_AUDIO_ANC_CH == (ANC_L_CH | ANC_R_CH)
        /***************************************************/
        /*************** right channel config **************/
        /***************************************************/
        SD_CFG->adpt_cfg_r.pnc_times = 1;
        // target
        SD_CFG->adpt_cfg_r.cmp_en = tg_cmp_en;
        SD_CFG->adpt_cfg_r.target_cmp_num = target_cmp_num;
        SD_CFG->adpt_cfg_r.target_sv = (float *)target_sv;
        SD_CFG->adpt_cfg_r.target_cmp_dat = (float *) tg_cmp;

        // 
        SD_CFG->adpt_cfg_r.IIR_NUM_FLEX = ICSD_IIR_NUM_FLEX;
        SD_CFG->adpt_cfg_r.IIR_NUM_FIX  = ICSD_IIR_NUM_FIX;
        for (int i = 0; i < 62; i++) {
            SD_CFG->adpt_cfg_r.Vrange_H[i] = Vrange_right_h[i];
            SD_CFG->adpt_cfg_r.Vrange_M[i] = Vrange_right_m[i];
            SD_CFG->adpt_cfg_r.Vrange_L[i] = Vrange_right_l[i];
        }

        for (int i = 0; i < 31; i++) {
            SD_CFG->adpt_cfg_r.Biquad_init_H[i] = biquad_right_h[i];
            SD_CFG->adpt_cfg_r.Biquad_init_M[i] = biquad_right_m[i];
            SD_CFG->adpt_cfg_r.Biquad_init_L[i] = biquad_right_l[i];
        }

        for (int i = 0; i < 10; i++) {
            SD_CFG->adpt_cfg_r.biquad_type[i] = biquad_type[i];
        }

        for (int i = 0; i < 7; i++) {
            SD_CFG->adpt_cfg_r.degree_set0[i] = _degree_set0[i];
            SD_CFG->adpt_cfg_r.degree_set1[i] = _degree_set1[i];
            SD_CFG->adpt_cfg_r.degree_set2[i] = _degree_set2[i];
        }

        SD_CFG->adpt_cfg_r.Weight_H = (float *)weight_h;
        SD_CFG->adpt_cfg_r.Weight_M = (float *)weight_m;
        SD_CFG->adpt_cfg_r.Weight_L = (float *)weight_l;
        SD_CFG->adpt_cfg_r.Gold_csv_H = (float *)mse_tar_h;
        SD_CFG->adpt_cfg_r.Gold_csv_M = (float *)mse_tar_m;
        SD_CFG->adpt_cfg_r.Gold_csv_L = (float *)mse_tar_l;

        SD_CFG->adpt_cfg_r.total_gain_adj_begin = total_gain_adj_begin;
        SD_CFG->adpt_cfg_r.total_gain_adj_end = total_gain_adj_end;
        SD_CFG->adpt_cfg_r.gain_limit_all = GAIN_LIMIT_ALL;

        // 
        SD_CFG->adpt_cfg_r.mem_curve_nums = mem_curves;
        SD_CFG->adpt_cfg_r.sz_table = (float *)sz_table_r;
        SD_CFG->adpt_cfg_r.pz_table = (float *)pz_table_r;
        SD_CFG->adpt_cfg_r.pz_table_cmp = NULL;
        SD_CFG->adpt_cfg_r.sz_table_cmp = NULL;
#if EXT_PRINTF_DEBUG
        for (int i = 0; i < 60; i++) {
            printf("idx=%d, mse=%d, weight=%d\n", i, (int)SD_CFG->adpt_cfg_r.Gold_csv_H[i], (int)SD_CFG->adpt_cfg_r.Weight_H[i]);
        }

        de_vrange_printf(SD_CFG->adpt_cfg_r.Vrange_H, SD_CFG->adpt_cfg_r.IIR_NUM_FLEX + SD_CFG->adpt_cfg_r.IIR_NUM_FIX);
        de_vrange_printf(SD_CFG->adpt_cfg_r.Vrange_M, SD_CFG->adpt_cfg_r.IIR_NUM_FLEX + SD_CFG->adpt_cfg_r.IIR_NUM_FIX);
        de_vrange_printf(SD_CFG->adpt_cfg_r.Vrange_L, SD_CFG->adpt_cfg_r.IIR_NUM_FLEX + SD_CFG->adpt_cfg_r.IIR_NUM_FIX);

        de_biquad_printf(SD_CFG->adpt_cfg_r.Biquad_init_H, SD_CFG->adpt_cfg_r.IIR_NUM_FLEX + SD_CFG->adpt_cfg_r.IIR_NUM_FIX);
        de_biquad_printf(SD_CFG->adpt_cfg_r.Biquad_init_M, SD_CFG->adpt_cfg_r.IIR_NUM_FLEX + SD_CFG->adpt_cfg_r.IIR_NUM_FIX);
        de_biquad_printf(SD_CFG->adpt_cfg_r.Biquad_init_L, SD_CFG->adpt_cfg_r.IIR_NUM_FLEX + SD_CFG->adpt_cfg_r.IIR_NUM_FIX);
#endif
#endif

    }
}

